import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

const UserList = () => {
  // Sample player data for each group
  const groupAPlayers = ["John Smith", "David Johnson", "Michael Taylor"];
  const groupBPlayers = ["Emily White", "Matthew Brown", "Olivia Wilson"];
  const groupCPlayers = ["Daniel Miller", "Sophia Davis", "Jackson Anderson"];

  return (
    <>
    <Header />
    <div>
      <h2>Group A Players</h2>
      <ul>
        {groupAPlayers.map((player, index) => (
          <li key={index}>{player}</li>
        ))}
      </ul>

      <h2>Group B Players</h2>
      <ul>
        {groupBPlayers.map((player, index) => (
          <li key={index}>{player}</li>
        ))}
      </ul>

      <h2>Group C Players</h2>
      <ul>
        {groupCPlayers.map((player, index) => (
          <li key={index}>{player}</li>
        ))}
      </ul>
    </div>
    <Footer />
    </>
  );
};

export default UserList;
